import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different wait strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Wait for search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 10000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Fill search input with 'iPhone'
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using different selector strategy
    await page.click('.search-btn');

    // Wait for results to load - using different approach
    await page.waitForTimeout(2000); // Brief pause for content to update

    // Wait for product cards to appear as confirmation of search results
    await page.waitForSelector('.product-card', { timeout: 15000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const productTitles = await page.$$eval('.product-title', titles => 
      titles.slice(0, 5).map(title => title.textContent.trim())
    );

    const productCount = await page.$$eval('.product-card', cards => cards.length);

    return {
      success: true,
      action: "Successfully searched for 'iPhone' products and retrieved results",
      extractedData: {
        productCount,
        sampleTitles: productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
